import React from 'react';
import { FaGithub,
  FaInstagramSquare,
  FaSnapchat,
  FaTwitter,
  FaYoutube,
  FaBell,
  FaHome,
  FaKaaba
} from "react-icons/fa";
import {
  GrGoogle,
  GrInstagram,
  GrSkype,
  GrWordpress


} from "react-icons/gr";
const SideBar = () => {
  return (
    <div>
      <FaGithub />
      <FaInstagramSquare />
    <  FaSnapchat/>
   <   FaTwitter/>
      <FaYoutube/>
      <FaBell/>
      <FaHome/>
      <FaKaaba/>
      <GrGoogle/>
      <GrInstagram/>
      <GrSkype className='btn btn-dark'/>
      <GrWordpress/>

    </div>
  )
}

export default SideBar
